import logo from './logo.svg';
import './App.scss';
import Home from './Home'
import DarkMode from './Navbar/darkMode';
import Navbar from './Navbar';
import { useState } from 'react';


function App(props) {

 
  const [modoDark, setModoDark] = useState(True);

  function darkMode () {

    if (modoDark === true) {
      setModoDark(false);
      const bgDark = { 
        backgroundColor:'#fff',
        filter: 'invert(100%)',
        
       }
    } 
    else if (modoDark === false) {
      setModoDark(true);
    }

  }
  
 
  

  return (

    <div className="App" style={bgDark}>


      <Navbar> <div onClick={darkMode}> <DarkMode/></div> </Navbar>
      
      <Home/>
      

    </div>
  );
}
export default App;
